import {
  Container,
  Table,
  TableHead,
  TableRow,
  TableCell,
} from "@mui/material";

export const KYsheetHints = () => {
  return (
    <Container>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell></TableCell>
          </TableRow>
        </TableHead>
      </Table>
    </Container>
  );
};
